from typing import *
class Solution:
    # Time Limit Exceeded
    def removeDuplicates(self, s: str) -> str:
        if_duplicate = True
        while if_duplicate:
            print(len(s))
            if len(s) == 1:
                return s
            for i in range(len(s ) -1 ):
                if s[i] == s[i+1]:
                    if len(s) == 2:
                        return ""
                    if_duplicate = True
                    s = s[:i]+ s[i+2:]
                    break
                if_duplicate = False
        return s

    # 80 ms, faster than 51.31% of Python3 online submissions for Remove All Adjacent Duplicates In String.
    # 14.8 MB, less than 20.40% of Python3 online submissions for Remove All Adjacent Duplicates In String.
    def removeDuplicates(self, s: str) -> str:
        stack = []
        for char in s:
            if len(stack) != 0:
                if char != stack[-1]:
                    stack.append(char)
                else:
                    stack.pop()
            else:
                stack.append(s)
        return "".join(stack)


